INSERT INTO `goal` VALUES (117,41,' A Arte do Podcasting','2023-10-19 03:00:00','2023-10-31 03:00:00','Vozes podem ser poderosas. Planejo lançar um podcast que destaque histórias inspiradoras de pessoas comuns. Marcas de áudio e contadores de histórias, vamos dar voz às histórias não contadas?\r\n',0,NULL,1,86,NULL),(118,41,'Lançar o GoalTwist: A Plataforma Definitiva para Realização de Objetivos','2023-10-19 03:00:00','2023-12-29 03:00:00','O GoalTwist não é apenas outra plataforma de acompanhamento de metas e objetivos. Ele será aprimorado com uma variedade de recursos, incluindo apoiadores, inteligência artificial e incentivos empresariais, com o objetivo de tornar a jornada para alcançar metas mais divertida e empolgante!',0,NULL,1,99,NULL),(119,41,'A Guerreira do CrossFit','2023-10-19 03:00:00','2024-05-30 03:00:00','A força vem da superação. Estou focado em participar e terminar em uma posição competitiva em pelo menos dois torneios de CrossFit. Academias e marcas de fitness, vamos levantar esses pesos juntos?\r\n',0,NULL,1,73,NULL),(120,41,'O Especialista em Nutrição','2023-10-20 03:00:00','2024-01-31 03:00:00','Comida é combustível. Estou determinado a obter uma certificação em nutrição esportiva para otimizar minha performance e saúde. Nutricionistas e educadores, vamos criar planos de refeição eficazes juntos?\r\n',0,NULL,1,54,NULL),(121,41,'Aspirante a Médico','2023-06-01 03:00:00','2024-12-31 03:00:00','Salvar vidas é minha vocação. Estou focado em passar no vestibular de medicina com distinção. Cursinhos e professores de biologia, vamos estudar a vida juntos?\r\n',0,NULL,1,54,NULL),(125,41,'Mestre Cervejeiro','2023-10-01 03:00:00','2023-12-29 03:00:00','A cerveja é mais do que uma bebida; é uma arte e uma ciência. Estou fascinado pela alquimia que transforma água, malte, lúpulo e levedura em uma infinidade de sabores e aromas. Meu objetivo é abraçar a tradição cervejeira, estudar suas técnicas e, finalmente, criar minhas próprias receitas excepcionais de cerveja. Dentro de um ano, quero produzir uma linha de cervejas artesanais que capturam a imaginação e agradam ao paladar. Marcas de ingredientes cervejeiros, equipamentos de fabricação e comunidade de cervejeiros, que tal embarcar nesta jornada etílica comigo?',0,NULL,1,66,NULL);
/*!40000 ALTER TABLE `goal` ENABLE KEYS */;
UNLOCK TABLES;

