INSERT INTO `goal_post` VALUES (141,121,41,'','👨‍⚕️ Aspirante a Médico: Com o Coração Voltado para Salvar Vidas 🩺\r\n\r\nOlá a todos! 👋 Meu nome é [Seu Nome], e estou em uma missão: tornar-me médico e fazer a diferença no mundo, um paciente de cada vez. 🌍\r\n\r\nPor que Medicina?\r\n\r\nA resposta é simples: é minha vocação. Sinto um chamado profundo para entender a complexidade da vida humana e usar esse conhecimento para ajudar as pessoas a viverem suas melhores vidas. ❤️\r\n\r\nMeu Plano\r\n\r\nEstou totalmente comprometido com este sonho e estou focado em passar no vestibular de medicina com distinção. 🎯 Para isso, estou buscando os melhores cursinhos e professores de biologia que possam me guiar nesta jornada fascinante. 📚\r\n\r\nVamos Juntos?\r\n\r\nQuem mais aí é apaixonado pela vida e pelo estudo dela? Professores, estudantes, entusiastas da medicina, vamos unir nossas forças e paixões para fazer a diferença! 🤝\r\n\r\n#Medicina #Vestibular #SalvarVidas #Biologia #EstudarFazBem','2023-10-29 04:45:14',NULL,NULL),(142,121,43,'','Olá Amanda 👋\r\n\r\nÉ incrivelmente inspirador ouvir sobre sua jornada para se tornar uma médica. 🩺 A medicina é uma das profissões mais nobres que existem, e o mundo definitivamente precisa de mais pessoas dedicadas e apaixonadas como você. 🌍\r\n\r\nO fato de você sentir essa vocação tão profundamente só reforça que você está no caminho certo. Salvar vidas e fazer a diferença na vida das pessoas é uma missão que poucos podem verdadeiramente abraçar com todo o coração. ❤️\r\n\r\nEstou confiante de que você alcançará seus objetivos e fará uma diferença significativa no campo da medicina. Você já tem o que é mais importante: a paixão e a vocação para ajudar os outros. 🙏\r\n\r\nDesejo-lhe todo o sucesso e realização em sua jornada para se tornar um médico. Estou aqui para apoiar você em cada passo do caminho! 👨‍⚕️\r\nSiga estas dicas que encontrei aqui no @goaltwist!\r\n\r\nGrande abraço!\r\n','2023-10-29 06:38:57',NULL,NULL),(143,121,42,'','Olá [Seu Nome]! 👋\r\n\r\nMeu nome é Nathly, e assim como você, também estou na incrível jornada para me tornar médica. 🩺 É tão bom encontrar alguém que compartilha dessa mesma paixão e vocação por ajudar os outros e fazer a diferença no mundo. 🌍\r\n\r\nSua determinação e foco são verdadeiramente inspiradores. A medicina é uma carreira exigente, mas com pessoas como você, estou confiante de que o futuro da saúde está em boas mãos. ❤️\r\n\r\nEstou aqui para apoiar você nessa missão e estou ansiosa para ouvir mais sobre suas conquistas e avanços. Vamos juntos tornar esse sonho realidade e fazer do mundo um lugar melhor, um paciente de cada vez. 🙏\r\n\r\nBoa sorte na sua jornada, e quem sabe um dia não seremos colegas de profissão? 👩‍⚕️👨‍⚕️\r\n\r\nE falando nisso, gostaria de te convidar para o nosso clube de estudos. Seria uma ótima oportunidade para trocarmos experiências e aprendizados e postar nossa jornada juntas no @goaltwist!','2023-10-29 06:49:20',NULL,NULL),(144,119,42,'','Olá Joana! 💪\r\n\r\nMeu nome é Nathly e, uau, estou verdadeiramente impressionada e inspirada pelo seu objetivo no CrossFit! 🏋️‍♀️ A paixão e a determinação que você mostra são incríveis.\r\n\r\n\"A força vem da superação\" - você não poderia ter dito melhor. Estou totalmente de acordo que desafiar a nós mesmos é a melhor forma de crescer, tanto fisicamente quanto mentalmente. 🌟\r\n\r\nEstou aqui para apoiar você nessa jornada desafiadora e empolgante. Tenho certeza de que você vai arrasar nos torneios e conseguir as parcerias que está buscando. 🤝\r\n\r\nVamos levantar esses pesos e conquistar esses objetivos juntas! 🏆\r\n\r\n','2023-10-29 07:09:03',NULL,NULL),(145,125,41,'','🍻 Olá Comunidade Cervejeira! 🍻\r\n\r\nEstou embarcando em uma viagem fascinante para me tornar um Mestre Cervejeiro. Acredito que a jornada será muito mais rica e gratificante com a participação e o apoio de todos vocês que compartilham da mesma paixão pela cerveja.\r\n\r\nSe você tem experiência em fabricação de cerveja, dicas sobre ingredientes, ou mesmo sugestões de equipamentos, por favor, clique em \"+ Apoiar\" e compartilhe seus conhecimentos.\r\n\r\nUm brinde à colaboração e à cerveja excepcional que vamos criar juntos! 🍺','2023-10-29 12:01:05',NULL,NULL),(146,125,44,'','🍺 Olá, Daniel Cabral! 🍺\r\n🍻 Olá, Amantes da Cerveja e Sonhadores! 🍻\r\n\r\nHoje quero dedicar algumas palavras ao meu grande amigo e talentoso mestre cervejeiro, Daniel Cabral da Silva. Daniel não é apenas um produtor de cerveja; ele é um artista, um criador de experiências e sabores que nos convida a explorar um universo de possibilidades líquidas.\r\n\r\n🌟 Acredite no Processo 🌟\r\nDaniel, cada grão de malte que você moe, cada lúpulo que você seleciona e cada fermentação que você monitora são passos na sua jornada. Não subestime o poder de um único passo.\r\n\r\n💪 Superação é a Chave 💪\r\nLembrando a todos que o caminho para o sucesso é árduo. Daniel, enfrentar desafios, como qualquer mestre cervejeiro sabe, faz parte do processo de criação. A superação desses desafios é o que nos faz crescer.\r\n\r\n🔥 Paixão Acima de Tudo 🔥\r\nO ingrediente mais importante em qualquer receita de cerveja é a paixão. Daniel, sua paixão é a chama que alimenta a arte da cervejaria. Mantenha essa chama sempre acesa!\r\n\r\n🌱 Sempre Aprenda, Sempre Cresça 🌱\r\nO mundo da cerveja é vasto e em constante evolução. Cada lote é uma nova oportunidade para aprender e aprimorar. Nunca pare de aprender, pois cada gota de conhecimento contribui para o oceano da maestria.\r\n\r\n🤝 Comunidade e Apoio 🤝\r\nNenhum de nós alcança o sucesso sozinho. Daniel, você tem uma comunidade aqui que acredita em você e no seu trabalho. Juntos, somos mais fortes.\r\n\r\nSe você se sente inspirado pela jornada do Daniel e acredita no poder da persistência, da paixão e da comunidade, clique em \"+ Apoiar\" e vamos juntos celebrar a arte da cervejaria!\r\n\r\nLevantem seus copos e brindem ao sonho, à paixão e à maravilhosa arte da cerveja! 🍻','2023-10-29 12:18:13',NULL,NULL),(147,125,41,'','🍻 Olá, Comunidade Cervejeira e Sonhadores de Plantão! 🍻\r\n\r\nPrimeiramente, quero expressar minha imensa gratidão ao Rodrigo Xavier, não apenas por suas palavras gentis e encorajadoras, mas também por ser um pilar de apoio na minha jornada como mestre cervejeiro.\r\n\r\n🌟 Gratidão e Reconhecimento 🌟\r\nRodrigo, sua mensagem foi um lembrete incrível de por que comecei nesta jornada para criar cervejas que tocam a alma. Você capturou a essência do que significa ser um mestre cervejeiro e eu não poderia estar mais agradecido.\r\n\r\n💪 Comunidade Forte, Sonho Forte 💪\r\nObrigado a todos que têm sido parte desta aventura. Como Rodrigo bem disse, nenhum de nós faz isso sozinho. A força da nossa comunidade é o que torna tudo possível.\r\n\r\n🔥 A Chama Continua Acesa 🔥\r\nSua mensagem reacendeu a chama da paixão que eu tenho pela arte da cervejaria. Esse é o combustível que me mantém indo, experimentando e criando.\r\n\r\n📚 A Jornada é o Tesouro 📚\r\nCada grão moído, cada lúpulo adicionado e cada fermentação monitorada são capítulos nesta incrível jornada. E cada um de vocês faz parte desta história.\r\n\r\nSe minha jornada e minhas cervejas de alguma forma tocam sua vida, por favor, clique em \"+ Apoiar\". Vamos continuar esta aventura deliciosa e espumante juntos!\r\n\r\nUm brinde a todos vocês, aos sonhos que nos movem e à incrível comunidade que nos apoia! 🍻\r\n\r\n','2023-10-29 12:20:53',NULL,NULL),(148,118,41,'','Bom dia! Hoje acordei às 4h30 da manhã para programar, meia hora antes do meu horário comum durante os dias úteis. Confesso que estou mais esgotado do que o normal, mas o desenvolvimento está progredindo. Essa é uma jornada repleta de altos e baixos; frequentemente, a tentação de tirar férias se torna quase irresistível.\r\nSobre a conclusão...ainda 29/12..\r\nPorém ontem algo me veio a cabeça.. talvez 3 mêses e meio..','2023-10-30 09:17:04',NULL,NULL),(149,118,41,'','Sexta-feira, 03 de novembro de 2023. A IA generativa está elevando-se a novos patamares, com o Chat GPT-5, Alexa transcendendo seu papel de rádio-relógio futurista, e o Google replicando quase tudo... kkkk. E eu aqui, com a aspiração de criar um suporte humano, bem ao lado de um dos maiores pulmões verdes de Curitiba, o Parque Tanguá, onde o calor humano, os olhares, sorrisos e selfies preenchem o espaço todos os dias! Mas então, como você vai tirar uma selfie com seu amigo Twister que mora dentro do seu bolso? É por isso que no GoalTwist, você encontrará apoiadores reais! A IA generativa será aquele amigo pronto para motivá-lo a levantar-se cedo e conhecer seus novos apoiadores, mesmo quando os outros estiverem ocupados. Vamos lá, Twisters! Como diz um provérbio chinês, \"quem espera pela sorte, espera pela morte\"! Vamos abraçar 2024 com entusiasmo, ao lado de humanos e máquinas. Acredite, aquele aspirador robô não será a coisa mais incrível que você verá! Aguardem!! 🤖+⚙️=🏃‍♀️❤️','2023-11-04 03:03:26',NULL,NULL),(150,118,41,'','Olá, Twisters! Hoje quero compartilhar com vocês uma grande vitória. Depois de meses de trabalho árduo, finalmente consegui implementar uma nova funcionalidade no nosso aplicativo GoalTwist. Agora, além de postar suas metas e receber apoio da nossa comunidade, você também pode curtir e reagir às postagens dos outros usuários. Isso não teria sido possível sem o apoio e a paciência de todos vocês. Então, do fundo do meu coração, obrigado! Vamos continuar trabalhando juntos para tornar o GoalTwist cada vez melhor. Lembre-se, cada pequeno passo conta na jornada para alcançar nossos objetivos. Vamos fazer de 2024 o nosso ano! 🚀🚀🚀','2023-11-09 01:51:20',NULL,NULL),(151,119,41,'','tesste','2023-11-13 13:29:08',NULL,NULL);
/*!40000 ALTER TABLE `goal_post` ENABLE KEYS */;
