ser/1697687495574_cabralcwb2019.jpg','https://www.meublogdedev.com','https://www.galeriadanielfotos.com','https://www.danieltube.com',NULL,'Um amanhecer dourado sobre as montanhas, seguido de um café da manhã tranquilo com minha família. Depois, um dia de aventura e exploração, terminando com um pôr do sol à beira-mar e um céu estrelado.','Ambientes tóxicos e pessoas negativas. A vida é curta demais para gastar energia em situações que drenam minha alegria e paz de espírito.','O sorriso da minha família. Nada me faz mais feliz do que ver as pessoas que amo felizes e saudáveis.','Estou preso no trânsito enquanto estou atrasado para um compromisso importante. Isso realmente testa minha habilidade de manter a calma.','Quando finalizei meu primeiro projeto como desenvolvedor de software. Foi um marco que provou que eu estava na carreira certa.','Depois de perder um prazo importante no trabalho. Foi um lembrete brutal, mas necessário, de que a procrastinação é minha inimiga.','A paixão por aprender coisas novas. Isso me mantém motivado e animado sobre a vida todos os dias.','Não espere pela oportunidade perfeita; crie-a. E lembre-se, o fracasso é apenas uma forma de você saber o que não funciona.','Minha empatia e minha capacidade de inspirar os outros. Parece clichê, mas é incrivelmente útil em minha vida pessoal e profissional.','Meu perfeccionismo e minha tendência para duvidar de mim mesmo. Estou trabalhando para transformá-los em pontos fortes.',NULL,1,NULL,1,'Eugenio flor 790','https://www.facebook.com/daniel.dev.silva','https://www.twitter.com/daniel_dev_silva','https://www.instagram.com/danielfotografo/',NULL,'https://www.linkedin.com/in/danielcabraldasilva/','https://www.pinterest.com/danielarte/'),(42,'Nath Cabral','nathly.gtw.santos@gmail.com','$2a$10$lpQYpV3NFc26Mk.mIeIpTebkPfVXztikkB24paFSiyZwYBpdA/MYy','google',NULL,NULL,'2023-10-17 09:58:17',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://lh3.googleusercontent.com/a/ACg8ocKnXxvDskmYzavJ8wTW8Df-fAlWq4yZyPft3Rc93M9TSg=s96-c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(43,'Daniel Cabral da Silva','cabralcwb2025@gmail.com','$2a$10$sbvmTK3luBnit722VW1.YOM0woBobHWzXgEZ7p7H/1N9rC1CS4DsW','google',NULL,NULL,'2023-10-29 02:08:19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://lh3.googleusercontent.com/a/ACg8ocJzBmlLq4fBFa1xUuQ0qvaDC2tGJlWX281_o81N_pMU_A=s96-c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(44,'Rodrigo Santos Xavier','rodrigo.xavier.santos@gmail.com','$2a$10$N6OI12AWAIS5KKJBRh0Jae0vzFwgguVe2qBSavwZLYRWfD/qCTDfm','local',NULL,NULL,'2023-10-29 12:01:59',NULL,NULL,'1960-12-20 03:00:00','(41)-99999-9999',1,5806,5806,NULL,106,'Um cervejeiro em busca do lúpulo perfeito, da fermentação ideal e do brinde mais memorável.','/upload/gtw/user/1698581307618_rodrigo.xavier.santos.jpg','','','',NULL,'Uma brassagem bem-sucedida pela manhã, degustação à tarde e um novo rótulo ao pôr do sol.','Cervejas mal feitas e desinformação sobre a arte da cervejaria.\n\n','A primeira degustação de uma nova receita que saiu como planejado.\n\n','Uma fermentação não vai como esperado.\n\n','Quando uma de minhas cervejas ganha um prêmio ou reconhecimento.\n\n','Aquela vez que a fermentação saiu completamente errada e tive que começar de novo.\n','O aroma de malte e lúpulo misturando-se no ar.\n\n','\"Faça cervejas como se ninguém estivesse assistindo; beba como se estivesse compartilhando com o mundo.\"\n\n','Um paladar afiado e um nariz treinado para nuances aromáticas.\n\n','Impaciência na fermentação e perfeccionismo nos detalhes.\n\n',NULL,1,NULL,1,'Rua Jovino de amaral, 220','','','',NULL,'',''),(45,'Daniel Silva','daniel.silva@gmail.com','$2a$10$Gb2Nw31jwlcAYIIjLX00juhIRyNBBOw8Y1yfTm9fcJ6N4VhitBkCS','local',NULL,NULL,'2023-11-14 17:04:52',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/assets/images/custom/avatar_placeholder.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
